import React from 'react';
import logo from './logo.svg';
import './App.css';

function MyInfo() {
  return (
    <div className="App">
      <header className="App-header">
        My Info
      </header>
      <h1>Nimra Nadeem</h1>
      <p>This is a paragraph about me.</p>
      <ul>
        <li>Apples</li>
        <li>Oranges</li>
        <li>Strawberries</li>
      </ul>
    </div>
  );
}

export default MyInfo;
